export const schema = `{
    "type": "object",
    "tablename": "People",

    "properties": {

      "name": {
        "type": "string"
      },

      "birthdate": {
        "type": "string",
        "format": "date"
      },

      "company id": {
        "type": "integer"
      }

    },

    "required": [
      "name",
      "company id"
    ]
  }`;

export default schema
